pragma solidity ^0.4.4;
import '../Owned.sol';
import './bancor/interfaces/ISmartToken.sol';
import { TrusteeFactory } from '../TrusteeFactory.sol';
import { Trustee } from '../Trustee.sol';
import { EntityFactory } from '../EntityFactory.sol';
import { IREO } from './IREO.sol';
import { SmartToken } from './bancor/SmartToken.sol';

contract LiquidRE is Owned {

    bool public status; // disable or enable contract
    address public entityFactory;
    address public trusteeFactory;
    address[] public IREOs;
    address[] public LRETs;

    event IREOCreated(address ireo);

    function LiquidRE(
        address _entityFactory,
        address _trusteeFactory
    )
        public
        Owned(msg.sender)
    {
        entityFactory = _entityFactory;
        trusteeFactory = _trusteeFactory;
        status = true;
    }

    modifier active() {
        require(status);
        _;
    }

    function addressEntity(address _address)
        public
        view returns (address)
    {
        EntityFactory entityFactoryInstance = EntityFactory(entityFactory);
        require(entityFactoryInstance.isEntityOwner(_address));
        return entityFactoryInstance.entityAddress(_address);
    }

    function addressTrustee(address _address)
        public
        view returns (address)
    {
        TrusteeFactory trusteeFactoryInstance = TrusteeFactory(trusteeFactory);
        require(trusteeFactoryInstance.isTrusteeOwner(_address));
        return trusteeFactoryInstance.trusteeAddress(_address);
    }

    function updateStatus(bool _disable)
        public
        ownerOnly
    {
        status = _disable;
    }

    function newIREO(
        address _trustee,
        uint256 _startTime,
        uint256 _endTime,
        uint256 _goal,
        uint256 _price
    )
        public
    {
        address _entity = addressEntity(msg.sender);
        TrusteeFactory trusteeFactoryInstance = TrusteeFactory(trusteeFactory);
        require(trusteeFactoryInstance.isTrustee(_trustee));
        SmartToken token = new SmartToken('', 'LRET', 18);
        IREO ireo = new IREO(_entity, _trustee, _startTime, _endTime, _goal, _price, token);
        token.disableTransfers(true);
        IREOs.push(ireo);
        Trustee trusteeContract = Trustee(_trustee);
        trusteeContract.addIREO(ireo);
        IREOCreated(ireo);

        /* address _entity = addressEntity(msg.sender);
        TrusteeFactory trusteeFactoryInstance = TrusteeFactory(trusteeFactory);
        require(trusteeFactoryInstance.isTrustee(_trustee));
        SmartToken token = new SmartToken('Test LRET', 'LRET', 18);
        token.disableTransfers(true);
        IREO ireo = new IREO(_entity, _trustee, _startTime, _endTime, _goal, _price, token);
        IREOs.push(ireo);
        Trustee trusteeContract = Trustee(_trustee);
        trusteeContract.addIREO(ireo);
        IREOCreated(ireo); */
    }

    function sendIREOToken(
        ISmartToken _token,
        uint256 _amount,
        address _to
    )
        public
    {
        IREO ireo = IREO(msg.sender);
        require(ireo.token() == _token);
        SmartToken token = SmartToken(_token);
        token.issue(_to, _amount);
    }

    function IREOsAddresses()
        public
        view returns(address[])
    {
        return IREOs;
    }

}
